import React from 'react';
import {Pie, PieChart} from 'recharts';

export type AnglePieDataProps = {
  AnglePieData:any
}

const AnglePie = (props:AnglePieDataProps)=> {
    return (
      <PieChart width={600} height={500}>
        <Pie dataKey="value" startAngle={180} endAngle={0} data={props?.AnglePieData} cx={170} cy={140} outerRadius={80} fill="#8884d8" label />
      </PieChart>
    );
  }

export default AnglePie;
